        "model.compile(loss='binary_crossentropy', optimizer='adam', metrics=['accuracy'])\n",
        "# Fit The model\n",
        "model.ﬁt(X_train, y_train,epochs=150,batch_size=10, verbose=1)\n",
        "# Evaluate The Model\n",
        "_, accuracy = model.evaluate(X_train, y_train) \n",
